import React from 'react';
import styled from 'styled-components';

const Styles = styled.div`

	display: grid;

    margin: 12%;


.hey{
	font-size:2em;
}
`;

function Home() {
	return(
		<Styles>

		<h3 className='hey'>Hey!</h3>
		How's it going?
		I am <h2>Bimarsha Khanal</h2>. It's nice to see here.
		Computer Engineering|Technophile|Autodidact


		</Styles>

		);
}

export default Home;
